import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './Components/App';
import { BrowserRouter } from "react-router-dom";

function Index() {
    const root = ReactDOM.createRoot(document.getElementById('root'));
    root.render(

        <React.StrictMode>
            <BrowserRouter>
                <App />
            </BrowserRouter>
        </React.StrictMode>

)};


